import * as React from "react";
import {Paper} from "@mui/material";
import Box from "@mui/material/Box";

export default function SomeInformation() {

    const paperStyle = {padding: "50px 20px", width: "90%", marginRight: "auto", borderRadius: 20, backgroundImage: "../public/img/Karina_I_Vlad.jpg"}


    return (
        <Paper elevation={2} style={paperStyle}>
            <Box>
                {/*<div className="hat">*/}
                {/*    <div className="ImgK">*/}
                        <div className="VladKarina">
                            Влад <tr/>И <tr/> Карина
                        </div>
                    {/*</div>*/}
                {/*</div>*/}
            </Box>
        </Paper>
    );
}
